import React from 'react';
import ReactDOM from 'react-dom';
import { App } from './pages/app';
import { Auth0Provider, onRedirectCallback } from '@auth0/auth0-react';

import { createBrowserHistory } from 'history';

const history = createBrowserHistory();

ReactDOM.render(
  <Auth0Provider
    history={history}
    domain="dev-pyo61mpz.auth0.com"
    clientId="hAO1NcwNS8oW0Bg2t101BACSK04trn4P"
    popupOrigin="localhost:3000"
  >
    <App />
  </Auth0Provider>,
  document.getElementById('root')
);
